import React from 'react';
import logo from '../img/logos.png'
import { Navbar, Nav, } from 'react-bootstrap';
import { Link,Router} from 'react-router-dom';
const Navigation = () => {

  // make fixed and change navigation color on scroll
  window.addEventListener("scroll", function () {
    var nav = document.querySelector("nav"); //ini new variable and use the nav selectio
    nav.classList.toggle("sticky", window.scrollY > 0); //add sticky call inside nav tag 

  })
  return (   
    <div className="navbar_body">
      <Navbar collapseOnSelect expand="lg"  id="subnanvar">
        <div className="container">
        <Navbar.Brand href="#home"><img src={logo} className="logo " alt="logo" /></Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="ml-auto menuitem">
            <Router><Link href="#hm"  to="/home" id ="home">Home</Link></Router>
           <Router> <Link href="#srcv" id ="home"  to="/ser" >Service</Link></Router>
          <Router>  <Link href="#skl" id ="home"  to="/skill" >Skill</Link></Router>
            <Router><Link href="#abt" id ="home"  to="/abt" >About Me</Link></Router>
          <Router>  <Link href="#cntc" id ="home"  to="/con" >Contact</Link></Router>
          </Nav>
          </Navbar.Collapse>
          </div>
      </Navbar>


    

    </div>


  )
}
export default Navigation;
